import React, {Fragment} from 'react'

const inputContainer = ({i}) => (
     <div>
        <input type="radio" name="" id={i}/>
        <label for = {i}>{i}</label>
    </div>
)
const SizeChart = () => {
    let links = []
    for(let i = 5; i <= 12; i++) {
        links.push(
        <Fragment>
        <div>
            <input type="radio" name="" id={i}/>
            <label for = {i}>US {i}</label>
        </div>
        </Fragment>
        )
    }
    return (
        <div className = 'size-chart'>
            {links}
        </div>
    )
}

export default SizeChart
